import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import {
  Box,
  Grid,
  CardActionArea,
  CardActions,
  CardContent,
  CardMedia,
  Button,
  Typography
} from "@material-ui/core";
import Navbar from "./Navbar";

const Portfolio = () => {
  return (
    <Box component="div">
      <Navbar />
      <Grid container justify="center">
        Hello from Portfolio component
      </Grid>
    </Box>
  );
};

export default Portfolio;
